  [],\n\t\"revision_timestamp\": \"2016-02-22T18:49:14.018651\",\n\t\"name\": \"coastal-maine-submerged-aquatic-vegetation-data-1993-1997-substrate\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Maine's eelgrass (SAV) meadows form an
  important aquatic habitat for the state. These meadows provide shelter for juvenile
  fish, and invertebrates. In certain locations they also help stabilize unconsolidated
  sediments and shorelines. Maine's Department of Marine Resources has mapped the
  SAV habitat for the entire coast using the Coastal Change Analysis Protocol. This
  mapping was accomplished from aerial photography acquired between 1993 and 1997.
  The unified coastal SAV data set is a composite of these multiple year data. The
  benthic data is classified according to the System for Classification of Habitats
  in Estuarine and Marine Environments (SCHEME). This system is fully described in
  \"Development of a System for Classification of Habitats in Estuarine and Marine
  Environments (SCHEME) for Florida, Report to U.S. EPA - Gulf of Mexico Program,
  Florida Fish and Wildlife Conservation Commission, Florida Marine Research Institute.
  Review Draft 12/04/02.\"\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
